\begin{itemize}
	\large\item simplest models - Anderson and Kondo
	\item localisation physics + hybridisation
	\item impurity is \focus{screened} at low \(T\)
\end{itemize}

\begin{minipage}{\textwidth}
\begin{itemize}
\item DMFT implementations use impurity models
\item Determine correct impurity model \focus{self-consistently}
\item Exact in $d=\infty$ limit
\item Displays \focus{metal-insulator} transition in Hubbard model at $\frac{1}{2}-$filling 
\end{itemize}
\end{minipage}

\begin{minipage}{\textwidth}
\begin{itemize}
\item Which \focus{single} impurity model shows such a \focus{transition}?
\item Can we relate impurity \focus{thermodynamics} to that of the bulk?
\item Which \focus{fluctuations} lead to the MIT?
\end{itemize}
\end{minipage}

\begin{itemize}
\item Introducing spin-exchange coupling and local attractive correlation in the bath leads to \focus{multiple phases} under RG.\\[3pt]
\item Ground state interpolates from singlet to local moment, passing through a \focus{spin-charge correlated} state.\\[3pt]
\item Many-particle \focus{entanglement} acts as order parameter for the transition.\\[3pt]
\item Impurity spectral function has three-peak structure at critical point, becomes \focus{gapped} beyond.
\end{itemize}

\begin{minipage}{0.6\textwidth}
\begin{itemize}
\item \focus{spin-exchange} $J$ between impurity \& bath
\item \focus{correlation} $U_b$ on zeroth site of bath
\item p-h symmetry is maintained
\item spin \& charge mutually exclusive, $J$ \& $U_b$ \focus{compete}
\end{itemize}
\end{minipage}

\begin{itemize}
\item Apply \focus{unitary} many-body transformations to the Hamiltonian
\item Successively \focus{decouple} high energy states
\item Obtain sequence of Hamiltonians and hence scaling equations
\end{itemize}
